import React from 'react';
import {RouteComponentProps} from 'react-router';
import AssociationShortInfo from '../../models/associationShortInfo.model';

/*import {
    GoogleMap,
    useLoadScript,
    Marker,
    InfoWindow,
} from "@react-google-maps/api";*/

type WalkConfirmedProps = {
    success?: string | undefined
}

function WalkConfirmedScreen({location}: RouteComponentProps<WalkConfirmedProps>) {

    const props = location.state as WalkConfirmedProps;

    return (
        <div>
            <br/>
            <div className="horizontal-center">
                {
                    /*!!props && !!props.success ?*/
                        <div>Šetnja je potvrđena, sada ju možete vidjeti u svom rasporedu.
                            <iframe
                                width="600"
                                height="450"
                                frameBorder="0"
                                src="https://www.google.com/maps/embed/v1/place?key=AIzaSyCIIskDofJHbJtt5-dBh7_p2s1HExY93BA
    &q=Space+Needle,Seattle+WA" allowFullScreen>
                            </iframe>


                        </div>
                       /* :
                        <div>Dogodila se greška, pokušajte ponovno prijaviti šetnju!</div>*/
                }
            </div>

        </div>
    );
}

export default WalkConfirmedScreen;
